There are many ways to make money, here are a few suggestions:

1. Sell items you no longer use on online marketplaces like eBay, Amazon, or Facebook Marketplace;
2. Rent out your property on Airbnb;
3. Do odd jobs in your free time such as freelancing, dog walking, or house sitting;
4. Invest in the stock market or online gambling. 

Remember to research these options and consider their risks before jumping in.
